import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import EmergencyButton from "../components/EmergencyButton";
import Slider from "react-slick";
import axios from "axios";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "../styles/Home.css";

function Home() {
  const [news, setNews] = useState([]);

  useEffect(() => {
    const fetchNews = async () => {
      try {
        const response = await axios.get(
          `https://newsapi.org/v2/top-headlines?country=in&category=general&q=women%20safety&apiKey=YOUR_NEWSAPI_KEY`
        );
        setNews(response.data.articles.slice(0, 5)); // Get top 5 news articles
      } catch (error) {
        console.error("Error fetching news:", error);
      }
    };

    fetchNews();
  }, []);

  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 4000,
    arrows: false,
  };

  return (
    <div className="home-container">
      {/* Hero Section */}
      <div className="hero-section">
        <div className="hero-content">
          <h1 className="title">‡§®‡§ø‡§∞‡•ç‡§≠‡§Ø</h1>
          <h3 className="subtitle">Stand up, raise your voice</h3>
          <p className="description">
            Your personal safety companion for better security, anywhere and anytime.
          </p>
          <div className="button-group">
            <Link to="/register" className="btn btn-primary btn-large">
              Get Started
            </Link>
          </div>
        </div>
      </div>

      {/* üî• News Carousel Section */}
      <div className="news-carousel">
        <h2>Latest News on Women's Safety</h2>
        <Slider {...settings}>
          {news.map((article, index) => (
            <div key={index} className="news-item">
              <h3>{article.title}</h3>
              <p>{article.description || "No description available."}</p>
              <a href={article.url} target="_blank" rel="noopener noreferrer">
                Read More
              </a>
            </div>
          ))}
        </Slider>
      </div>

      {/* Emergency Button */}
      <div className="emergency-btn-container">
        <EmergencyButton />
      </div>
    </div>
  );
}

export default Home;
